To those of you who wasted your time and resources downloading the previous, truncated print of this movie, please accept my apology for having done such a sloppy job encoding it. 

This print was ripped directly from the DVD9 version released in France and contains the complete movie from that release. If you're looking for either the Theatrical or Director's cut released in the USA, you'll have to look elsewhere.



A very good quality DVD9 rip.


